import Sections from "./sections";

export default function SeasonsFlowers() {
  const items = [
    { title: "Tulips" },
    { title: "Daffodils" },
    { title: "Hydrangeas" },
    { title: "Sunflowers" },
    { title: "Daisies" },
    { title: "Spring Plants" },
  ];
  return <Sections title={"Shop All Spring Flowers"} items={items}></Sections>;
}
